  false,\n\t\"url\": null,\n\t\"notes\": \"Using Leica Geosystems ALS50 Laser Systems,
  89 flight lines with a nominal point spacing = 1.4 meters (4.59 feet) were collected
  over Erie County, NY (approximately 1044 square miles). Multiple returns were recorded
  for each laser pulse along with an intensity value for each return. The data acquisition
  occurred in missions on April 17, 2008 and April 28, 2008. During the LIDAR campaign,
  the field crew conducted a GPS field survey to establish final coordinates of the
  ground base stations for final processing of the base-remote GPS solutions. This
  is a bare earth classified data set; points are classified as ground or unclassified.
  Please note that water points are sometimes classified as 'Unclassified' and other
  times as 'Ground'. LIDAR data is remotely sensed high-resolution elevation data
  collected by an airborne collection platform. Using a combination of laser range
  finding, GPS positioning and inertial measurement technologies; LIDAR instruments
  are able to make highly detailed Digital Elevation Models (DEM) of the earth's terrain,
  man-made structures and vegetation. This data was collected at a resolution to aid
  in coastal management decisions including flood plain analysis and mapping.\",\n\t\"license_title\":
